	public static void main( String[] args )
	{
		new MaximalRectangle( ).test( );
	}

	char[][] toMatrix( String[] strs )
	{
		char[][] matrix = new char[strs.length][];
		for ( int i = 0; i < matrix.length; i++ )
		{
			matrix[i] = strs[i].toCharArray( );
		}
		return matrix;
	}

	char[][] toMatrix( String str, int column )
	{
		int row = str.length( ) / column;
		char[][] matrix = new char[row][];
		for ( int i = 0; i < row; i++ )
		{
			matrix[i] = str.substring( row * column, ( row + 1 ) * column )
					.toCharArray( );
		}
		return matrix;
	}

