	public class Solution
	{

		public int maximalRectangle( char[][] matrix )
		{
			LinkedList<Rect> rects = new LinkedList<Rect>( );
			for ( int y = 0; y < matrix.length; y++ )
			{
				int start = -1;
				int end = -1;
				for ( int x = 0; x < matrix[y].length; x++ )
				{
					if ( matrix[y][x] == '1' )
					{
						if ( start == -1 )
						{
							start = x;
						}
						end = x;
					}
					else
					{
						if ( start != -1 )
						{
							addRect( rects, start, y, end );
						}
						start = -1;
						end = -1;
					}
				}
				if ( start != -1 )
				{
					addRect( rects, start, y, end );
				}
				removeRects( rects, y );
			}
			removeAllRects( rects );
			return maxSize;
		}

		class Rect
		{

			Rect( int x, int y, int ex, int ey )
			{
				this.x = x;
				this.y = y;
				this.ex = ex;
				this.ey = ey;
			}

			public String toString( )
			{
				return "[" + x + "," + y + "," + ex + "," + ey + "]";
			}
			int x;
			int y;
			int ex;
			int ey;
		}

		int maxSize = 0;

		protected void removeAllRects( LinkedList<Rect> rects )
		{
			for ( Rect rect : rects )
			{
				removeRect( rect );
			}
			rects.clear( );

		}

		protected void removeRects( LinkedList<Rect> rects, int y )
		{
			Iterator<Rect> iter = rects.iterator( );
			while ( iter.hasNext( ) )
			{
				Rect rect = iter.next( );
				if ( rect.ey != y )
				{
					removeRect( rect );
					iter.remove( );
				}
			}
		}

		protected void removeRect( Rect rect )
		{
			int size = ( rect.ex - rect.x + 1 ) * ( rect.ey - rect.y + 1 );
			if ( size > maxSize )
			{
				maxSize = size;
			}
		}

		protected void addRect( LinkedList<Rect> rects, int x, int y, int ex )
		{
			if ( rects.isEmpty( ) )
			{
				rects.add( new Rect( x, y, ex, y ) );
				return;
			}

			boolean createNew = true;
			ListIterator<Rect> iter = rects.listIterator( );
			while ( iter.hasNext( ) )
			{
				Rect rect = iter.next( );
				if ( rect.ex < x && rect.ey != y )
				{
					removeRect( rect );
					iter.remove( );
					continue;
				}
				if ( rect.ey != y && rect.ex >= x && rect.x <= ex )
				{
					int nx = Math.max( rect.x, x );
					int nex = Math.min( rect.ex, ex );
					iter.add( new Rect( nx, rect.y, nex, y ) );
					if ( nx == x && nex == ex )
					{
						createNew = false;
					}
					continue;
				}
			}
			// add the rect to the list
			if ( createNew )
			{
				rects.add( new Rect( x, y, ex, y ) );
			}
		}
	}

